import React, { Component } from "react";
import { Col, Container, Row } from "react-bootstrap";

class Nav extends Component {
  render() {
    return (
      <nav>
        <Container>
          <Row className="top">
            <Col></Col>
          </Row>
        </Container>
        <Container>
          <Row className="shadow bottom">
            <Col></Col>
          </Row>
        </Container>
      </nav>
    );
  }
}

export default Nav;
